import Display from './display'

const Catchdisplay = (props) => {

    const [allMovies, setAllMovies]=useState([])

        useEffect(()=> {
            const fetchMovies = async () => {

               const response =await fetch(`http://www.omdbapi.com/?s=${props.onChange}&apikey=10cf3ef8`)
               const responseData = await response.json()
               console.log("ResonseData:")
               console.log(responseData)

               const movies = responseData.Search;

               const loadedMovies= []

               loadedMovies.push({
                   key:Math.random(),
                   ...movies
               })

               setAllMovies(loadedMovies)
            //    console.log(responseData.Search)


            }
            fetchMovies(props.onChange)
        }, [props])

        // console.log("allMovies:")
        // console.log(allMovies)


    return(<React.Fragment>

        {
        allMovies.map((movie) => (
             <Display movies={movie}/>
        ))}

        {console.log("*******")}
        {console.log(props.onChange)}
       </React.Fragment>)
}

export default Catchdisplay
